description:
Mutant creatures are unleashed when researchers made the wrong discovery. Eight survivors must be rescued from outpost beneath the earth.

Something has gone terribly wrong at research station 320, a secret research facility one mile beneath the earth's surface. All communications are gone, all means of escape destroyed and an extremely dangerous horde of rapidly mutating ancient flesh eating creatures are consuming everything in their path.

Eight survivors barricade themselves inside a remote area of the facility with little food, almost no means of defense and little hope of rescue...
